  <div>
    <h1>HATS PAGE</h1>
  </div>
);

function App() {
  return (
    // <div>
    //   <HomePage />
    // </div>
    <div>
      <Route path="/" component={HomePage} />
      <Route path="/hats" component={HatsPage} />
    </div>
  );
}

export default App;
